import "./quemSomosRow.css"

const quemSomosRow = ({image, title, subtitle}) => {
    const source = image;
    
    return (
        <div className="QuemSomosRow">
            <div className="QuemSomosColumnImage">
                <img src={source}/>
            </div>
            <div className="QuemSomosColumnInfo">
                <div className="RowInfo">                            
                    <div className="RowTitle">
                        <h2>{title}</h2>
                    </div>
                    <div className="RowSubTitle">
                        <h4>{subtitle}</h4>
                    </div>  
                </div>
            </div>
        </div>
    );
}

export default quemSomosRow;
